import React from 'react';

function Dashboard() {
  return (
    <div style={{color:'white', fontSize:'25px'}}>
      <h1>Student Dashboard</h1>
      <p>Welcome to your dashboard! Here you can see your grades, assignments, and other important information.</p>
      <div>
        <h2>Grades</h2>
        <table>
          <thead>
            <tr>
              <th>Subject</th>
              <th>Grade</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>Math</td>
              <td>A-</td>
            </tr>
            <tr>
              <td>English</td>
              <td>B+</td>
            </tr>
            <tr>
              <td>Science</td>
              <td>B</td>
            </tr>
          </tbody>
        </table>
      </div>
      <div>
        <h2>Assignments</h2>
        <ul>
          <li>Math - Chapter 5 Practice Problems</li>
          <li>English - Essay on "To Kill a Mockingbird"</li>
          <li>Science - Lab report on Photosynthesis</li>
        </ul>
      </div>
    </div>
  );
}

export default Dashboard;
